                { titulo: '1. PRIMERA. OBJETO.', texto: ' El servicio que desarrolla “EST” como empresa de servicio temporal consiste en colaborar temporalmente en la actividad de “EU” mediante el envío de empleados en misión a los sitios de trabajo que indique “EU” para que ejecuten las actividades de colaboración temporal bajo la subordinación delegada de “EU”, de conformidad con el numeral 3º del Artículo 77 de la Ley 50 de 1990, en concordancia con el parágrafo del Artículo 2.2.6.5.6 del Decreto 1072 de 2015. en las condiciones, requisitos y asignaciones salariales de conformidad con lo solicitado por la misma “EU”.' },
