                { titulo: '2. SEGUNDA. TARIFA(S) EMPRESA DE SERVICIOS TEMPORALES.\nCOBRO DE ADMINISTRACIÓN POR LA PRESTACIÓN DEL SERVICIO TEMPORAL “AIU”:', texto: ' El porcentaje de administración o la cuota fija aceptada en la propuesta comercial para el pago de la factura electrónica es de ' + this.aiu_negociado },
                { titulo: 'PLAZO DE PAGO DE LA FACTURA ELECTRONICA: ', texto: ' Los días negociados en la propuesta comercial para el pago de la factura electrónica es de ' + this.plazo_pago + ' días.\n\nCONDICIONES ESPECIALES: \nVER ANEXO N° 3: PROPUESTA ECONÓMICA VIGENTE.\n' },
                { titulo: '', texto: 'PARÁGRAFO PRIMERO. Una vez finalicen las pruebas técnicas de conocimiento y la “EU” decide seleccionar alguno de los aspirantes o candidatos remitidos, previa iniciación de las actividades ya sean de inducción, entrenamiento o etapa de evaluación de aptitudes, se deberá informar a la “EST” para suscribir contrato de trabajo, efectuar afiliaciones a la Seguridad Social, y además se deben garantizar todas las prestaciones al trabajador. (Art. 80 C.S.T.). La “EU” deberá abstenerse de ensayar a cualquier candidato remitido por la “EST” en la ejecución real de la labor misional sin que este cuente con las respectivas afiliaciones a la seguridad social, en caso de accidente o reclamación como consecuencia de una prueba técnica de conocimiento que implique ejecución de la labor misional dentro o fuera de las instalaciones de la “EU” será exclusiva responsabilidad la “EU” las reclamaciones que por ello llegaran a presentar los candidatos en su momento.\nPARÁGRAFO SEGUNDO. Si del grupo de candidatos filtrados y reclutados por el equipo de Selección de la “EST”, la “EU” desea vincular directamente alguno para el cargo solicitado, La “EU” deberá pagar a la “EST”, la suma equivalente al cien por ciento (100%) del salario que el candidato devengará mensualmente una única vez, suma que será facturada por la empresa aliada en servicios de outsourcing de selección SERVICIOS ADMINISTRATIVOS AL INSTANTE S.A.S.\nPARÁGRAFO TERCERO. La “EU” se obliga reembolsar a la “EST” los costos de las evaluaciones médicas ocupacionales de ingreso, periódicas, de retiro, certificados de alturas, pruebas de idoneidad de conductores, de manipulación de alimentos y demás pruebas o valoraciones médicas complementarias que se requieran para el ejercicio de la labor misional, en función de las condiciones de trabajo y factores de riesgo a las que estaría expuesto el trabajador en misión, acorde con los requerimientos de la tarea y el perfil del cargo, además la “EU” asume el costo de dichas evaluaciones y en ningún caso, podrán ser cobrados ni solicitados al trabajador en misión, dando cumplimiento a lo estipulado en la Resolución 2346 de 2007. De igual manera, asume el costo de las evaluaciones médicas en los casos en que no sean efectivos los ingresos.' },
                { titulo: '3.TERCERA. COBROS, PAGOS, FORMA DE PAGO.', texto: 'Cada vez que la “EST” pague salarios a los empleados en misión, lo hará de acuerdo con las novedades efectivamente reportadas por la “EU”, las cuales en virtud de la transmisión de nómina electrónica deberán ser reportadas dentro del mismo periodo que se causaron por parte de la “EU” y al momento de emitir paz y salvo sin dejar novedades pendiente, suma que serán facturadas por “EST” y pagadas por la “EU” en un término no superior a los días indicados en la propuesta comercial ' + this.plazo_pago + ' días y en la cláusula segunda de este contrato, pago que podrá llevarse a cabo a través de consignación/transferencia en una de las cuentas bancarias de la “EST” Las partes aceptan que la factura presta mérito ejecutivo y que en caso de incumplimiento generará de manera inmediata el cobro de interés moratorios a la máxima tasa legal definida por la Super Intendencia Financiera de Colombia. La factura aquí indicada Incluye los costos inherentes a los contratos de trabajo, como son:\nA) Salario básico y todo tipo de pago constitutivo de salario efectivamente causados y pagados. \nB) El porcentaje correspondiente a los aportes al sistema de Seguridad Social que se viere obligado a pagar la “EST” a las entidades de la Seguridad Social según lo que establezca la Ley Colombiana y el 22,21% correspondiente a la totalidad de las prestaciones sociales que se discriminan en la aceptación de la propuesta comercial.\nC) Sobre los valores indicados en los literales anteriores la “EST” facturará a la “EU” un porcentaje de administración según lo indicado en la propuesta comercial y en la cláusula segunda de este contrato (Ver Anexo N° 3. Propuesta Económica vigente) por concepto de administración sobre los costos totales por cada trabajador, como pago correspondiente al servicio objeto del presente contrato.\nD) Para las cuotas fijas “EST” efectuará los reajustes de dicha cuota, al inicio de cada año de acuerdo incremento del Salario Mínimo Legal Mensual Vigente definido por el gobierno nacional.\nPARÁGRAFO PRIMERO. En caso de presentarse ausentismo o licencias no remuneradas por parte del empleado en misión, se facturará igualmente el valor de la administración. Es decir, le suma al subtotal el salario que deja de devengar el trabajador como base para el cálculo de la administración.\n PARÁGRAFO SEGUNDO. De conformidad con lo establecido en los Artículos 78 y 81, numeral 4, de la Ley 50 de 1990 y 13 y el decreto reglamentario 1530 de 1996, la “EU” reconocerá a la “EST” la misma tarifa por riesgos profesionales que debe aportar a la ARL por sus trabajadores de planta y de conformidad a lo establecido en el Decreto 768 de 2022.\nPARÁGRAFO TERCERO. En caso de cambio en la legislación o jurisprudencia colombiana, que genere incremento en las obligaciones para los empleadores, en materia tributaria, de seguridad social, porcentajes de riesgos de ARL, aportes parafiscales, salario mínimo, auxilio de transporte, horas extras, dominicales, festivos u otros pagos de carácter obligatorio, la “EST” trasladará inmediatamente a la “EU” el mayor costo debidamente soportado y éste deberá asumirlo dentro de los plazos convenidos en el presente contrato.\nPARÁGRAFO CUARTO. las vacaciones del trabajador en misión se facturarán incluyendo el concepto de auxilio de transporte, esto con el ánimo de provisionar los cambios de salario que pueda llegar a tener por los incrementos obligatorios de Ley. Las vacaciones del trabajador siempre se liquidarán con el último salario devengado.' },
                { titulo: '4. CUARTA. RECEPCIÓN DE FACTURAS ELECTRÓNICAS.', texto: ' Sin perjuicio de la radicación en físico, “EU” manifesta que recibirá las facturas electrónicas que se generen por la prestación de los servicios objetos del presente contrato al correo electrónico: ' + this.correo_facturacion_electronica },
                { titulo: '5. QUINTA. ACEPTACIÓN DE LA FACTURA ELECTRÓNICA DE VENTA COMO TÍTULO VALOR.', texto: ' Atendiendo a lo indicado en los Artículos 772, 773 y 774 del Código de Comercio, la factura electrónica de venta como título valor, una vez recibida, se entiende irrevocablemente aceptada por LA EMPRESA USUARIA en los siguientes eventos: a) Aceptación expresa: Cuando, por medios electrónicos, acepte de manera expresa el contenido de ésta, dentro de los tres (3) días hábiles siguientes al recibo de la mercancía o del servicio. b) Aceptación tácita: Cuando no reclamare al emisor en contra de su contenido, dentro de los tres (3) días hábiles siguientes a la recepción de la documentación o del servicio. El reclamo se hará por escrito en documento electrónico.' },
                { titulo: '6. SEXTA. REAJUSTES.', texto: 'En aras del equilibrio económico, si durante la prestación del servicio se generara un cambio en la propuesta económica que incida en el presente contrato, las partes procederán de manera conjunta a reajustar los valores de la cotización inicial en una suma igual a la propuesta económica.' },
                { titulo: '7. SÉPTIMA. DURACIÓN.', texto: 'El presente contrato tendrá la duración prevista de doce (12) meses. En caso de no comunicar la intención de terminación del contrato en los términos indicados en la Cláusula Octava y Cláusula Novena, una vez llegado el plazo de vencimiento, el mismo podrá prorrogarse en los mismos términos de la vigencia inicial y se mantendrá vigente mientras se den ordenes/solicitudes de servicios o haya requerimientos de colaboración en ejecución, y en general, mientras haya personal en misión prestando sus servicios en la “EU”.\nPARÁGRAFO PRIMERO. Si pasados dos meses calendario después de la celebración del contrato, no se ha emitido facturación por la prestación del servicio temporal, se terminará el presente contrato de forma automática por inejecución del objeto contractual. Si posteriormente la “EU” requiere de los servicios de la “EST” tendrá que celebrar un nuevo contrato surtiendo nuevamente la etapa precontractual correspondiente, según el proceso de contratación establecido por la “EST” para la prestación del servicio.\nPARÁGRAFO SEGUNDO. A menos que por disposición expresa o tácita ambas partes decidan de manera mancomunada ejecutar el contrato en los términos convenidos desde la suscripción y celebración del contrato. En estos casos tendrá prevalencia los actos positivos directamente encaminados a la ejecución del contrato que la terminación del mismo por las razones y los términos indicados en el parágrafo primero de la presente clausula.' },
                { titulo: '8. OCTAVA. TERMINACION CON JUSTA CAUSA.', texto: ' Así mismo cualquiera de las partes se reserva el derecho de darlo por terminado por el incumplimiento de las obligaciones contractuales por cualquiera de las partes, para este caso la notifcación de la terminación se podrá hacer de manera inmediata sin que se requiera preaviso alguno, sin que la terminación genere ningún tipo de indemnización para quien la invoca. La inactivación de los servicios de colaboración por más de treinta (30) días se tendrá como justa causal para dar por terminado el contrato misional y en consecuencia en caso de requerir con posterioridad el envío de trabajadores misionales, se deberá suscribir un nuevo contrato de prestación de servicios' },
                { titulo: '9. NOVENA. TERMINACION SIN JUSTA CAUSA.', texto: ' En los casos de terminación unilateral sin la invocación de una justa causal, por alguna de las partes, bastará para ello el aviso previo y escrito dado a la otra parte con treinta (30) días calendario de anticipación a la fecha en la cual se dará por terminado el servicio, sin que la terminación genere ningún tipo de indemnización para quien la invoca. NOTA ACLARATORIA N° 3: Toda terminación con o sin justa causa la “EU” deberá colocarse al día con el pago de nóminas realizados hasta la fecha' },
                { titulo: '10.DÉCIMA. DESTINACIÓN | SUBORDINACIÓN ADMINISTRATIVA DELEGADA. ', texto: ' Previo requerimiento de la “EU” a la “EST” contratará los empleados en misión de conformidad con lo establecido en la Ley 50 de 1990 y las demás normas que modifiquen, aclaren, adicionen, complementen o subroguen estas disposiciones. Por consiguiente, dicho personal deberá ejecutar directa y personalmente la labor que la “EST” le señale en su contrato y la “EU” debe destinar al empleado en misión única y exclusivamente para el desempeño de las labores para las que fue enviado. Sin embargo, la “EST” delega en la “EU” la facultad de controlar directamente el trabajo de dicho personal y la de impartir ordenes, instrucciones en cuanto tiempo modo y lugar, así como la de cualquier otra indicación que facilite ejercer en nombre de la “EST” la supervisión de dicho personal debido al tipo de servicio que prestará el empleado en misión, como también por su localización. No obstante, la “EU” no podrá destinar en ninguna circunstancia al empleado en misión para el desempeño de labores distintas de aquellas para la que fue requerido y contratado.\nPARÁGRAFO PRIMERO. En relación con los empleados en misión, éstos estarán sujetos a las obligaciones, prohibiciones, faltas y sanciones que se establezcan en el Reglamento Interno de Trabajo tanto de la “EU” como de la “EST”, pero la acción disciplinaria corresponde exclusivamente al EMPLEADOR, esto es a la “EST” a través del proceso disciplinario establecido para tal fin. Adicional, la “EU” debe instruir a los empleados en misión, en cuanto a los procedimientos, guías, protocolos, normas y demás documentos establecidos en la “EU” y de igual forma, no podrá ordenar ni permitir que el empleado en misión exceda los lineamientos señalados en la Ley y la Jurisprudencia vigente que en materia laboral lo protege.\nPARÁGRAFO SEGUNDO. De conformidad con lo establecido de manera exclusiva para los usuarios de las “EST”, en la Sentencia de abril 24 de 1997, expediente 9435, de la Corte Suprema de Justicia, Sala Laboral, la “EU” podrá dar órdenes, impartir instrucciones a los trabajadores en misión y exigir el cumplimiento de estas, en desarrollo del servicio específico de colaboración contratado, sin que por esto adquieran el carácter de empleador.' },
                { titulo: '11.DÉCIMA PRIMERA. RESPONSABILIDAD LABORAL. ', texto: 'El vínculo entre la “EST” y los empleados que ejecutan labores misionales en la “EU” será de carácter laboral, asumiendo las responsabilidades inherentes del empleador. En consecuencia, la “EST” manifiesta expresamente que cumple con todas y cada una de las obligaciones impuestas por la Ley, para efectos del pago de las acreencias que se causen con ocasión del Contrato de Trabajo, como: afiliaciones, pago de salarios, prestaciones sociales, horas extras, recargos diurnos, nocturnos, dominicales, festivos y pago a las entidades de seguridad social. La “EST” informará a la “EU” periódicamente los aportes a las entidades de seguridad social de todos los empleados en misión de la “EU”.' },
                { titulo: '12. DÉCIMA SEGUNDA. CONSIDERACIONES ESPECIALES CONTRATACIÓN Y/O VINCULACIÓN DIRECTA DE EMPLEADOS EN MISIÓN. ', texto: 'Si la “EU” informa a la “EST” la culminación de la obra o labor de un empleado en misión reclutado por el equipo de selección de SAITEMP S.A. para contratarlo directamente para la misma labor, en un tiempo inferior a seis (6) meses de servicio temporal, la “EU” deberá igual pagar la suma equivalente al cien por ciento (100%) de un mes de salario, según lo indicado en el PARÁGRAFO SEGUNDO de la CLÁUSULA SEGUNDA de este contrato.' },
                { titulo: '13. DÉCIMA TERCERA. CONSIDERACIONES ESPECIALES DE RESPONSABILIDAD. ', texto: 'La “EST” no asume responsabilidad alguna por daños, robos, sustracciones, hurtos y demás eventos delictivos a equipos, maquinarias, mercancías, vehículos o dinero y en general a bienes o valores, incluso la información confidencial de la “EU” que se haya entregado o esté bajo custodia de los empleados en misión, ni tampoco por abusos de confianza, falsificación de documentos, falsedad y otros hechos similares; por lo cual la “EU” será la única responsable de la protección de sus bienes y será ésta a quien le corresponde las acciones legales pertinentes en contra de los empleados infractores tendientes al resarcimiento de perjuicios que se haya causado, sin que en ningún momento la “EST” asuma responsabilidad alguna sobre estos bienes y valores. En caso de que la “EU” lo decida, podrá contratar, a su costo, seguros que amparen esos valores y la responsabilidad contractual o extracontractual, frente a terceros, que se derive de las labores de los empleados en misión será asumida directamente por la “EU”. Lo anterior en virtud que la “EST” está imposibilitado técnica y administrativamente para supervisar, vigilar y custodiar los bienes, maquinarias, mercancías, vehículos, dineros y en general cualquier bien susceptible de valoración propio de la actividad económica de la “EU”, porque es esta la que puede ejercer directamente el control y supervisión sobre estos trabajadores en ejercicio de la subordinación delegada, y es la directamente responsable del manejo de los bienes e instrumentos de labor, de los cuales es su propietaria o tenedora.\nPARÁGRAFO PRIMERO. La “EST” acompañará las acciones disciplinarias en contra del trabajador misional que ejecuté alguna de las conductas indicadas en este numeral, adelantará gestiones para conciliación o autorizaciones de descuento, tramite de consignación de prestaciones sociales ante los jueces laborales, colaboración en la investigación, pero no asume la responsabilidad extracontractual, penal por los daños, perjuicios o delitos de los trabajadores. La “EST” procurará mediante sus diferentes dependencias adelantar acciones encaminadas a recuperar dineros, a ubicar el trabajador en caso de abandono, a mediar entre la “EU” y el trabajador en caso divergencias, a buscar salidas negociadas tendientes a resarcir daños que se hayan podido causar, entre otros. Todo dentro del marco de la legalidad y respetando los mínimos garantizados que otorga la Ley al trabajador.' },
                {
                    titulo: '14. DÉCIMA CUARTA. OBLIGACIONES DE LA EMPRESA USUARIA (EU). ', texto: 'Se obliga a: (I) Informar antes de la ejecución del contrato a la “EST” los exámenes médicos de ingreso, periódicos, de egreso y aquellos especiales que se requieran de acuerdo con los servicios contratados por parte de la “EU”. (II) De ser necesario que los trabajadores en misión trabajen horas extras, la “EU” deberá contar con la autorización expedida por el Ministerio del Trabajo, por parte de la “EST” a su vez, deberá informar, de manera veraz y oportuna, y en los formatos que para el efecto señala la “EST” el tiempo realmente laborado por los trabajadores en misión y las novedades que se presenten. La “EU” será responsable de la exactitud en el reporte del tiempo laborado por todos y cada uno de los trabajadores en misión y deberá presentarlo a la “EST” para efectos del pago de nómina de estos. En caso de que se inicien investigaciones por parte de entidades administrativas y judiciales a la “EST”, por el reporte erróneo, defectuoso o el incumplimiento de esta obligación por parte de la “EU”, esta deberá responder por las sanciones económicas que se impongan en virtud de las investigaciones adelantadas, así el contrato comercial haya finalizado. (III) Pagar oportunamente la retribución que se causa a favor de la “EST” de acuerdo con la cláusula vigésima- retiros a solicitud de la empresa usuaria. (IV) Incluir a los trabajadores en misión en programas culturales, recreativos, deportivos que la “EU” tenga establecido para sus propios trabajadores, de acuerdo con lo establecido en el Artículo 79 de la Ley 50 de 1990.(V) Entregar la dotación, los elementos de protección personal y los elementos corporativos de la “EU” que se requieran para la ejecución del objeto de este contrato. (VI) Asignar al trabajador en misión únicamente las funciones para las cuales fue contratado por la “EST”. (VII) Implementar el Decreto 1072 de 2015 y la Guía Técnica para la implementación del SG - SST frente a los trabajadores en misión de las EST y sus EMPRESAS USUARIAS, expedida por la Dirección de Riesgos Laborales del Ministerio del Trabajo. (VIII) Informar inmediatamente la “EST” vía telefónica y / o correo electrónico, sobre la ocurrencia de todo accidente de trabajo de los trabajadores en misión, y diligenciar el reporte de accidente correspondiente.Las sanciones económicas derivadas de la demora en el Reporte del Accidente de trabajo por culpa de la “EU”, serán asumidas por esta. (IX) Se compromete a dar cumplimiento a las políticas de SAGRILAFT y HABEAS DATA definidas por la “EST”. (X) La “EU” pagará todos los costos inherentes que se generen en virtud de la prestación efectiva del servicio temporal de colaboración contratado, más el costo de administración que pacten las partes. (Ver Anexo N° 3. Propuesta Económica vigente)(XI) Se obliga que los sitios de trabajo cumplan las exigencias de la legislación sobre Seguridad y Salud en el Trabajo y la Guía Técnica para la implementación del SG - SST legal vigente frente a los trabajadores en misión de las EST y sus usuarias. (XII) Suministrar periódicamente a la “EST” la documentación que acredite el cumplimiento de las normas de Seguridad y Salud en el Trabajo de su empresa frente a los trabajadores en misión. (XIII) Se obliga con la ARL de la “EST” al cumplimiento de las normas de Seguridad y Salud en el Trabajo y su implementación en los trabajadores en misión. (XIV) Se obliga a informar a la “EST” sobre las posibles faltas disciplinarias en que incurra el trabajador en misión, para que la “EST” tome las medidas pertinentes. (XV) Frente a la posible asociación de los trabajadores en misión a sindicatos de la “EU”, se obliga a: (I) Informar inmediatamente a la “EST” cuando tenga conocimiento de la afiliación de trabajadores en misión en sindicatos de su industria o empresa. (II) No pagar ningún valor directamente por concepto de afiliación de cuota sindical, negociaciones colectivas, entre otros que se puedan llegar a causar, en caso de asumir estos valores sin consultar por escrito en los medios de atención a la “EST”, la “EU” correrá con esos gastos, (III) Pagar la totalidad de los costos en que incurra la “EST” provenientes de descuentos de cuota sindical, negociaciones colectivas, entre otros, que se puedan llegar a causar por un trabajador en misión sindicalizado en sindicatos de la “EU”. (XVI) Acoger al trabajador en misión en las fechas que disponga en su empresa para el disfrute de la jornada familiar a la que hace referencia la Ley 1857 de 2017. En caso de no disponer de tal fecha, la “EU” será la encargada de brindar la jornada libre semestral tal como lo indica la Ley 1857 de 2017.(XVII) Informar a la “EST”, con treinta(30) días de anticipación sobre la terminación definitiva del contrato comercial de suministro de personal, para que la “EST”, pueda gestionar la terminación de los contratos laborales por obra o labor de los trabajadores en misión. (XVIII) Los daños y perjuicios derivados de accidentes, incidentes de trabajo ocasionados con culpa, dolo, negligencia o por falta de aplicación al SG - STT y este contrato, harán responsable a la “EU” frente a los costos en los que incurra la “EST”, para reparar los daños y perjuicios al trabajador o a sus familiares. (XIX).La “EU” deberá abstenerse de ejecutar actos propios del empleador tales como sancionar, finalizar el contrato de trabajo, dar directamente remuneraciones o bonificaciones a los trabajadores en misión. (XX) OBLIGACIONES SG - SST. Sin perjuicio de la responsabilidad de la “EST” como empleador de sus trabajadores en misión, la “EU” se obliga a que los sitios de trabajo cumplan con las exigencias contempladas en el Decreto 1072 de 2015, en la Guía técnica para la implementación SG - SST frente a los empleados en misión de EST y sus usuarias(expedida por el Ministerio de trabajo), en la resolución 1409 de 2012, y demás normas que modifiquen, deroguen, o actualicen este tema, por lo cual, la “EU” deben incluir los empleados en misión dentro de sus Programas de Seguridad y Salud en el Trabajo, para lo cual deben suministrarles: una inducción completa e información permanente para la prevención de los riesgos a que están expuestos dentro de, la “EU”, los elementos de protección personal, dotación y entrenamiento que requiera el empleado en misión en el puesto de trabajo y velar por las condiciones de seguridad para prevenir lesiones y enfermedades. (XXI) Dar respuesta en un plazo no mayor a tres(3) días hábiles al proceso de atracción y selección, respecto a si las hojas de vida de los candidatos remitidos se ajustan al perfil de la vacante solicitada. (XXII) En caso de presentarse queja formal por parte de un trabajador en misión de la “EST” denunciando presunto acoso laboral por parte de los empleados directos de la “EU” o sus representantes, se compromete adelantar todos los correctivos necesarios, conducentes y pertinentes para cesar los hechos generadores del supuesto acoso, del mismo modo, se compromete a gestionar las sugerencias y solicitudes que realice el comité de convivencia laboral la “EST”. '
                },
                { titulo: '15. DÉCIMA QUINTA. OBLIGACIONES DE LA EMPRESA DE SERVICIOS TEMPORALES SAITEMP S.A. (EST). ', texto: '(I) Contratar laboralmente y por escrito el personal en misión requerido para ejecutar el servicio temporal de colaboración contratado comercialmente por la “EST” con la “EU”, de modo que se ajuste a los requerimientos fijados por éste; para cumplir con el objeto del presente Contrato. La “EST” se obliga a efectuar un proceso de selección acorde con la naturaleza de este Contrato y a poner en consideración de la “EU” las hojas de vida para la selección de los trabajadores en misión. Del mismo modo se enviarán las hojas de vida disponibles de los candidatos que acepten las condiciones de la oferta y se ajusten a la vacante solicitada, sin garantizar un número máximo o mínimo de hojas de vida. (II) Afiliar al trabajador en misión al Sistema de Seguridad Social Integral. (III) Pagar oportunamente al personal en misión los salarios, prestaciones sociales, el pago de los aportes de cada uno de los trabajadores en misión tanto a la Seguridad Social como a los parafiscales y demás normas concordantes, así como las demás acreencias laborales que por ley correspondan. (IV) Llevar una carpeta con los documentos de ingreso e historia laboral de cada trabajador en misión que reposarán en las dependencias de la “EST”. (V) Retirar del servicio al trabajador o trabajadores cuya remoción sea solicitada por la “EU”, dando estricto cumplimiento a las disposiciones jurisprudenciales y legales para cada caso. (VI) Facilitar en caso de requerir los aportes de todos los trabajadores en misión y las cotizaciones al Sistema Integral de Seguridad Social Integral. (VII) Vigilar y responder por la Seguridad y Salud en el Trabajo en los términos de la ley y la Guía Técnica para la implementación del SG-SST frente a los trabajadores en misión de las EST y sus usuarias, expedida por la Dirección de Riesgos Laborales del Ministerio del Trabajo. (VIII) Investigar los accidentes de trabajo y enfermedades laborales de los trabajadores en misión de acuerdo con la normatividad vigente. (IX) Informar a la “EU” de cualquier novedad que se presente con los trabajadores designados para el desarrollo del presente Contrato (X) En general, a cumplir estrictamente las disposiciones laborales vigentes. (XI) Cumplir los acuerdos pactados con la “EU” relacionados con la prestación del servicio, en los procesos de atracción, selección, preingreso, contratación y nómina.' },
                { titulo: 'DÉCIMA SEXTA. INSTRUCCIONES Y RECOMENDACIONES PARA LA EMPRESA USUARIA (EU). ', texto: 'La “EU” debe respetar y acatar todas las instrucciones y recomendaciones que desde el proceso de Seguridad y Salud en el Trabajo de la “EST” tenga implementadas, siendo exclusiva responsabilidad de la “EU” reportar a la “EST” cualquier condición que pueda poner en riesgo la salud de los empleados en misión y los accidentes de trabajo que se presenten por causa u ocasión del trabajo.\nNOTA ACLARATORIA N° 4. La “EU” debe incluir a los empleados en misión que realizan actividades que generan riesgo de caída mayor a 1.50mt, tales como trabajos en escaleras, andamios, plataformas sin barandas, estanterías, elevadores, bordes de losas, trabajos en suspensión, entre otras, dentro de su programa de protección contra caídas, asegurando las condiciones en las cuales se ejecutan dichas actividades y garantizando la seguridad del personal en misión que se encuentra en las instalaciones donde desarrolla la actividad; cumpliendo tanto con la realización de los exámenes médicos con énfasis en trabajo en altura como con la entrega de los elementos de protección contra caídas – EPCC programación del curso de altura por cuenta de la “EU” de conformidad a lo establecido en resolución 4272 de 2021 y demás requisitos contemplados en la Resolución 1409 del 2012. En caso de no cumplir con lo anteriormente especificado, la “EU” será la directamente responsable por las reclamaciones de tipo económico que puede generar por su omisión.\nNOTA ACLARATORIA N° 5. Si la “EU” requiere que la” EST” se haga cargo de la consecución y entrega de la dotación, de los elementos para la protección personal, curso de alturas u otro semejante para el ejercicio de la labor misional, la “EU” deberá hacer la solicitud al momento del ingreso o durante la vigencia del contrato misional, contando la “EST” con treinta (30) días hábiles para atender el requerimiento y los costos serán facturados con pago anticipado a ordenes de la “EU” ya que los mismos no se encuentran contemplados en el porcentaje de administración de la propuesta comercial. (Ver Anexo N° 3 Propuesta Económica Vigente). Además, la” EST” cobrara a la “EU” el equivalente en porcentaje de la administración negociada en la propuesta comercial sobre el valor de la dotación, cursos, elementos de protección personal o semejante solicitados por la “EU”.' },
                { titulo: '17. DÉCIMA SÉPTIMA. PÓLIZA DE SEGURO DE CUMPLIMIENTO DISPOSICIONES LEGALES.', texto: 'La “EST” tiene para garantizar sus obligaciones una Póliza, expedida por la compañía de SEGUROS DEL ESTADO S.A., Dicha póliza rige desde el primero (1) de enero del año en curso a las cero (00:00) horas, hasta el treinta y uno (31) de diciembre a las 24 horas del mismo año y garantiza el pago de salarios, prestaciones sociales e indemnizaciones laborales de los empleados en misión, en caso de iliquidez de la “EST” de conformidad con la Ley 50/90 en su Art. 83 Numeral 5º y el decreto 4369/2006. Esta póliza se actualiza anualmente y podrá ser solicitada por la “EU” en cualquier momento.' },
                { titulo: '18. DÉCIMA OCTAVA. REPORTE DE NOVEDADES.', texto: 'La “EU” se compromete hacer llegar los reportes de novedades con dos (2) días hábiles de anticipación al pago de la nómina y es responsable de la exactitud en dicho reporte, en materia de tiempo laborado para efectos de horas extras, dominicales, festivos, recargos nocturnos, compensatorios, ausentismos (licencias, incapacidades), auxilios, bonificaciones y cualquier otro ingreso extra percibido por el empleado en misión o deducción autorizada por el mismo. En el evento en que la “EU” no informe con la debida antelación los recargos generados por cualquiera de las causas antes especificadas, la “EST” solo pagará al empleado en misión el salario básico de conformidad con el periodo de pago y exime a la “EST” de dichas responsabilidades. Las incapacidades cuyo origen sea de enfermedad general serán reconocidas por la EPS a partir del tercer (3) día de esta, siempre y cuando al momento de ocurrencia del evento el empleado tenga cuatro (4) semanas continuas efectivamente pagadas al sistema de seguridad social, de lo contrario, los salarios del empleado incapacitado serán facturados a la “EU”. Cuando el trabajador en misión tiene derecho al pago de la prestación económica de la incapacidad médica, se le restituirá a la “EU” por medio de una nota crédito cuando la EPS haya reconocido y pagado la correspondiente incapacidad.\nPARÁGRAFO PRIMERO. Solamente la “EU” podrá programar el trabajo suplementario de horas extras, siempre y cuando no supere el número de horas extras autorizadas por el Ministerio de Trabajo. Acatando lo dispuesto por La ley 2191 de 2022 desconexión laboral y la Ley 2101 de 2021 reducción de la jornada.\nPARÁGRAFO SEGUNDO. Los pagos que realiza la “EST” al empleado en misión, corresponden a las novedades de nómina reportadas directamente por la “EU”. Por lo tanto, la “EST”. liquidará las prestaciones sociales, la seguridad social y los aportes parafiscales del empleado en misión de acuerdo con el IBC o salario promedio que generen dichas novedades.\nPARÁGRAFO TERCERO. LA “EU” se obliga a comunicar a la “EST” durante el término de vigencia del presente contrato, todos los beneficios extralegales que brinde al personal a su servicio relacionado con alimentación, recreación, capacitación y transporte, así como su escala salarial, para preservar el principio de igualdad entre sus empleados y los empleados en misión.\nPARÁGRAFO CUARTO. En caso que se inicien investigaciones por parte de entidades administrativas y judiciales a la “EST” por el incumplimiento de valores que correspondan a periodos de tiempo, jornadas de trabajo, auxilios y bonificaciones que la “EU” no hubiere incluido en los reportes periódicos para la liquidación de la nómina, la “EU” deberá responder por las sanciones económicas que se impongan en virtud de las investigaciones adelantadas, así el contrato comercial haya finalizado y exime a la “EST” de responsabilidades.' },
                { titulo: '19.DÉCIMA NOVENA. ESTABILIDAD LABORAL REFORZADA POR FUERO DE SALUD. ', texto: 'Todo trabajador en misión que presuntamente ostente un fuero ocupacional, la “EST” junto con la “EU”, deberán mantener el vínculo laboral contractual hasta tanto el Ministerio del Trabajo, proceda a autorizar dicha terminación, a menos que se presente renuncia voluntaria por parte del trabajador, momento en el cual se procederá a su aceptación por escrito y tramite de desvinculación pertinente. Para la respectiva protección constitucional respecto del derecho a la estabilidad ocupacional reforzada, por parte de la “EST” y la “EU”, se llevarán a cabo los siguientes pasos:\n1- Se verificará que el fuero ocupacional o situación de debilidad manifiesta cumple con los requisitos reconocidos por la ley y la jurisprudencia para otorgar estabilidad laboral reforzada.\n2- Si agotado este primer paso, se determina que el trabajador en misión goza de la protección constitucional, la “EU” se abstendrá de dar por terminado el servicio misional hasta tanto no se obtenga la autorización de la entidad de supervisión vigilancia y control administrativa de la que habla el artículo 26 de la Ley 361 de 1997.\n3- En caso que la “EU” insista en terminar la obra o labor contratada del trabajador en misión y se niegue en recibirlo en sus instalaciones, este asumirá de manera consecutiva y permanente el pago de los salarios, prestaciones sociales, seguridad social, parafiscales y el valor de la administración delegada del trabajador, mientras no se cumpla con la autorización señalada en el numeral anterior de esta formalidad.\n4- En relación a lo anterior, la empresa de servicios temporales iniciara con la solicitud ante el ministerio del trabajo de la terminación de la relación contractual del trabajador en misión, siempre y cuando obtenga los requisitos establecidos por las causales inmersas en el (Ver Anexo N° 3 Propuesta Económica Vigente) técnico vigente para la fecha de la solicitud y las demás normas concomitantes vigentes al momento del requerimiento realizado por la EST.\n5- Cabe anotar que la empresa de servicios temporales buscará los requisitos establecidos en la normatividad vigente de acuerdo a las causales objetivas, justas causas incluyendo la establecida en el artículo 2.2.1.1.5 del Decreto 1072 de 2015 o el hecho insuperable e incompatible, así como la aplicación de las distintas herramientas jurídicas para minimizar los costos para la “EU” tales como la suspensión del contrato de trabajo en concordancia al Artículo 51 numeral 1 del CST, el IUS VARIANDI entre otras figuras.\n6- Una vez la empresa de servicios temporales obtenga los requisitos para solicitar el levantamiento del fuero ocupacional ante el ministerio del trabajo, iniciará el trámite cuyo radicado será enviado a la “EU”, so pena de incumplimiento del contrato de la referencia.\n7- Lo mismo aplicara cuando el trabajador pueda reconocérsele la pensión de invalidez o afines previa valoración de la proyección de la PCLO o revisión de este valor porcentual.\n8- Cada actuación que realice la “EST” en concordancia de los casos prioritarios que gocen del fuero ocupacional o se encuentren en debilidad manifiesta deberá ser informado a “EU” una vez se concreten.\n9- Así mismo se concertará entre la “EST” y la “EU” reuniones periódicas para dar a conocer el avance del plan de acción de cada trabajador que sea sujeto de la protección constitucional del fuero de salud o de quien se encuentre en debilidad manifiesta.\n10- Una vez sea notificada a la empresa de servicios temporales la autorización de la terminación de la relación contractual del trabajador en misión por parte del ministerio del trabajo en cualquiera de sus instancias o reiteraciones de la solicitud, el reconocimiento de la pensión de invalidez o afines, así como la renuncia del trabajador el pago del emolumento económico por parte de la “EU” cesara.\n11- En los casos de estabilidad laboral reforzada la “EST” para el proceso médico, la rehabilitación o calificación del trabajador en misión e igualmente, realizará bajo su costo toda gestión o trámite técnico o jurídico que se requiera para la finalización del contrato individual de trabajo y el retiro del trabajador en misión.' },
                { titulo: '20. VIGÉSIMA. RETIROS A SOLICITUD DE LA EMPRESA USUARIA. ', texto: 'En el caso que la “EU” informe a la “EST” la cesación de la necesidad de la obra y/o labor o labor del trabajador en misión, solo se reconocerá el valor de los salarios, prestaciones sociales y demás novedades relacionadas con tal personal hasta la fecha de la solicitud de retiro, siempre y cuando la “EU” avise por escrito a la “EST”, máximo el mismo día que se genera esta novedad, puesto que de lo contrario la “EU” asumirá los costos que esa omisión demande. PARÁGRAFO PRIMERO. Las partes son conscientes de la amplia protección legal y jurisprudencial, que obliga a la continuidad del contrato laboral, según el principio de estabilidad reforzada, en casos como: pre pensionados, empleados que se encuentren incapacitados por accidentes de trabajo, enfermedad general o laboral, a los que estén en tratamiento médico o con recomendaciones y/o restricciones, fuero de pre pensionado y a las mujeres en estado de embarazo, en licencia de maternidad, periodo de lactancia, licencia de paternidad y fuero de paternidad o los demás casos posteriores que la ley imponga. En dichos casos, la “EU” no podrá notificar la cesación de la necesidad de la obra y/o labor para la cual fue contratado el trabajador en misión, ni requerir a la “EST” para terminar el servicio misional de un empleado con fuero, sin la previa autorización del Ministerio del Trabajo y sin que sea levantada la novedad que le otorgó el fuero, ya que son protegidos y amparados legalmente y deberán permanecer en las instalaciones de la “EU”, hasta que desaparezcan las causas que dieron origen a tal protección. En consecuencia, la “EU” se compromete a mantener en al trabajador misional amparado con fuero de estabilidad laboral reforzada en un cargo donde pueda acatar las restricciones o recomendaciones acorde al fuero que le da la protección, hasta la finalización de las causas que dieron origen o por autorización del Ministerio del Trabajo en los casos que aplique. En el evento, en que la “EU” exija prescindir de un trabajador en misión protegido con fuero y se niegue a mantener la ejecución de la actividad misional en sus instalaciones, la “EU” se obliga a rembolsar a la “EST” los salarios, provisión de prestaciones, seguridad social y demás sumas de dinero que tuviere que asumir objeto de la reubicación laboral, un reintegro laboral o de una sanción por parte de las entidades administrativas o judiciales.' },
                { titulo: '21. VIGÉSIMA PRIMERA. TRATAMIENTO Y PROTECCIÓN DE DATOS PERSONALES. ', texto: 'En concordancia con la Ley Estatutaria 1581 de 2012, SAITEMP S.A. asume las obligaciones como responsable del tratamiento de los datos personales de todas y cada una de las personas naturales que estén involucradas en el marco de la ejecución del objeto del presente contrato. De la misma forma, y en los casos en que la “EU”, en la ejecución del presente contrato (u otros celebrados con la “EST”), acceda o pueda llegar a acceder a los datos personales de los empleados en misión, de conformidad con lo establecido en la Ley Estatutaria 1581 de 2012 obtendrá la condición de Encargado del tratamiento de dichos datos. Por esta razón, deberá dar estricto cumplimiento a las obligaciones surgidas de los deberes establecidos en el Artículo 18 de la mencionada ley, así como a los decretos que la reglamentan y demás documentos concordantes.\nPARÁGRAFO PRIMERO. la “EU”, podrá acceder sólo a los datos personales que permita la “EST” sobre su personal en misión y únicamente para la finalidad exclusiva de la realización del servicio contratado. Si existiere alguna solicitud específica relacionada con información personal, esta será analizada bajo los parámetros de la normativa colombiana en protección de datos personales, de tal manera que no se vulneren los derechos de Hábeas Data y la Intimidad de los titulares de dicha información personal.\nPARÁGRAFO SEGUNDO. la “EU”, y cualquier miembro que haga parte de su personal, se obliga al secreto profesional respecto de los datos personales y se obliga a no revelar la información que reciba durante la ejecución y cumplimiento del objeto del presente contrato. Así mismo, LA “EU”, y cualquier miembro que haga parte de su personal, se abstendrán de obtener, compilar, sustraer, ofrecer, vender, intercambiar, enviar, comprar, interceptar, divulgar, modificar y/o emplear los mencionados datos para las actividades y fines diferentes a los contratadas.\nPARÁGRAFO TERCERO. La “EU”, y cualquier miembro que haga parte de su personal, se compromete a devolver o suprimir los datos personales suministrados, terminada la vigencia de las relaciones contractuales. Esta condición aplica aun después de la vigencia de la relación contractual y se obliga a mantenerla de manera confidencial protegiendo los datos personales para evitar su divulgación no autorizada.\nPARÁGRAFO CUARTO. En caso de que la “EU”, sea requerida por cualquier autoridad, para temas relacionados con los empleados en misión, esta deberá dar respuesta a dicha autoridad, indicando que la solicitud se debe realizar directamente la “EST”.\nPARÁGRAFO QUINTO. La “EU”, se obliga a reportar o comunicar inmediatamente, al Oficial de Protección de Datos Personales de SAITEMP S.A., cuando tenga conocimiento de pérdida, vulneración, modificación o cualquier otro tipo de incidente que ponga en peligro la seguridad, integridad o confidencialidad de los datos personales a los que les dé tratamiento en la ejecución de las actividades contratadas.\nPARÁGRAFO SEXTO. En caso de que la “EU” no haya implementado las disposiciones establecidas en Régimen Colombiano de Protección de Datos Personales, se obliga a adoptar las medidas establecidas por la “EST” para garantizar la seguridad de los datos personales a los que le dará tratamiento (recolección, almacenamiento, uso, circulación y/o eliminación) y evitar su alteración, pérdida y/o tratamiento no autorizado. El incumplimiento de lo aquí dispuesto, así como lo daños y perjuicios que se deriven de ello, será asumido por la parte que incumple, pudiendo constituir causal de terminación unilateral del contrato por la otra parte.' },
                { titulo: '22. VIGÉSIMA SEGUNDA. INTEGRIDAD Y CONFIDENCIALIDAD. ', texto: 'Este contrato documenta de manera exhaustiva, el acuerdo total y completo entre las partes que lo constituyen y, por lo tanto, reemplaza, sustituye, deroga y deja sin efectos cualquier otro contrato, acuerdo verbal o escrito, expreso o tácito, que exista o pudiera existir entre las partes o alguno de sus integrantes.  El presente contrato, incluyendo sus anexos (propuesta comercial, modificaciones contractuales que las partes llegasen a suscribir de manera bilateral, otro sí y acuerdos), cuando sea del caso, podrá ser modificado por las partes por mutuo acuerdo, consignado por escrito y previa evidencia de que quienes representan a las partes están debidamente facultados para tal efecto. Además, acuerdan las partes que se obligan a mantener la confidencialidad sobre el presente contrato.' },
                { titulo: '23. VIGÉSIMA TERCERA. PREVENCIÓN LAVADO DE ACTIVOS Y FINANCIACIÓN DEL TERRORISMO. ', texto: 'Las partes se obligan a realizar todas las actividades encaminadas a asegurar que todo su personal a cargo, empleados, socios, accionistas, administradores, clientes, proveedores, etc., y los recursos de estos, no se encuentren relacionados o provengan, de actividades ilícitas; particularmente, de lavado de activos o financiación del terrorismo. En todo caso, si durante el plazo de vigencia del convenio se encontraren en alguna de las partes, dudas razonables sobre sus operaciones, así como el origen de sus activos y/o que alguna de ellas, llegare a resultar inmiscuido en una investigación de cualquier tipo (penal, administrativa, etc.) relacionada con actividades ilícitas, lavado de dinero o financiamiento del terrorismo, o fuese incluida en las listas internacionales vinculantes para Colombia, de conformidad con el derecho internacional (listas de naciones unidas- ONU), en listas de la OFAC o Clinton, etc., la parte libre de reclamo tendrá derecho de terminar unilateralmente el convenio sin que por este hecho, esté obligado a indemnizar ningún tipo de perjuicio a la parte que lo generó. La “EU”, manifiesta que la información aportada verbalmente y/o por escrito, relacionada con el Sistema para la Administración del Riesgo del Lavado de Activos y Financiación del Terrorismo-SAGRILAFT- es veraz y verificable, y se obliga de acuerdo las normas vigentes en la materia a: (1). Proporcionar toda la información, Formularios, anexos y soportes que la Empresa considere necesarios para controlar el riesgo de LAFT/FAPDM. (2). Actualizar una vez al año, la documentación e información aportada que exige el CONTRATANTE para el conocimiento del cliente, dando cumplimiento a las disposiciones contenidas tanto en el Manual SAGRILAFT de la EMPRESA, las cuales son concordantes con las normas vigentes en la materia.\nPARÁGRAFO PRIMERO. El incumplimiento por parte de la “EU” de lo establecido, en esta cláusula, dará lugar a la terminación anticipada del presente contrato.' },
                { titulo: '24. VIGÉSIMA CUARTA. MÉRITO EJECUTIVO. ', texto: 'El presente contrato presta mérito ejecutivo por ser una obligación clara, expresa y exigible para las partes, y no requerirá de constitución en mora para ser ejecutado a través de la jurisdicción ordinaria.' },
                { titulo: '25. VIGÉSIMA QUINTA. HONORARIOS DE ABOGADOS. ', texto: 'En el caso de que la “EST” requiera iniciar acciones legales por incumplimiento de la “EU” de las disposiciones de este contrato, al igual que por el impago de las facturas en los términos indicados en esta cláusula y en el contrato, la “EST” cobrará a la “EU”, sobre el valor total de la deuda más intereses, el quince por ciento (15%) de los honorarios que se llegaran a causar por concepto de acciones pre jurídicas y jurídicas.' },
                { titulo: '26. VIGÉSIMA SEXTA. SOLUCIÓN DE CONTROVERSIAS. ', texto: 'Toda diferencia o controversia que surja entre las partes a causa de este contrato se resolverá directamente entre las partes en disputa. Empero, si ello no fuere posible o cualquiera de las partes involucradas en la disputa no estuviere en disposición de arreglar directamente tales diferencias, deberá agotarse una diligencia de conciliación extrajudicial en derecho ante cualquier entidad legalmente autorizada para efectuarla y en caso de no llegar a un acuerdo, se acudirá a la administración de justicia por la vía ejecutiva.\nPARÁGRAFO PRIMERO. El presente contrato, se rige por las leyes de la República de Colombia y deberá ser interpretado conforme a ellas. La solución de controversias que puedan derivarse de su ejecución se rige por dichas leyes.\nPARÁGRAFO SEGUNDO. Se deja constancia que entre los contratantes no existe vinculación económica, en los términos del capítulo XI del libro 2do. Del Código de Comercio.' },
                { titulo: '27. VIGÉSIMA SÉPTIMA. ACUERDO Y ACEPTACIÓN PARA USO E IMPLEMENTACIÓN DE LA FIRMA ELECTRÓNICA. ', texto: 'Como representantes legales de las Partes, aceptamos firmar electrónicamente los formatos de registro de proveedores, contratos, y demás documentos que se adelanten o tramiten entre ellas, así como la implementación de la firma electrónica para todas las transacciones de índole laboral que se celebren con los trabajadores que prestan servicios misionales. En consecuencia, autorizamos al proveedor definido por la “EST” para tal menester, como proveedor tecnológico para enviar documentos, mensajes, avisos o notificaciones a nuestros correos electrónicos; realizar controles de verificación y seguridad mediante preguntas; enviar mensajes de texto o SMS al teléfono móvil registrado en la base de datos de proveedores; e identificar la ubicación, la dirección IP o los datos del ordenador, entre otros.' },
                { titulo: '28. VIGÉSIMA OCTAVA. DIRECCIONES DE NOTIFICACIÓN. ', texto: 'Para todos los efectos a los que haya lugar se tendrán como direcciones las indicadas en el encabezado del contrato.' },
                { titulo: '29. VIGÉSIMA NOVENA. DOMICILIO CONTRACTUAL. ', texto: 'Se señala como domicilio contractual para todos los efectos del presente contrato la Ciudad donde opera con cobertura a nivel nacional en las sedes que actualmente tenga o preste servicio la “EST”.' },
                { titulo: '30.TRIGÉSIMA. PERFECCIONAMIENTO. ', texto: 'El presente contrato se entiende perfeccionado con la suscripción de este, reconociendo ambas partes la autenticidad de sus firmas, por lo que renuncian a la diligencia previa de reconocimiento de contenido y firmas.' },
                { titulo: '31.TRIGÉSIMA PRIMERA. AUTORIZACION ESPECIAL. ', texto: 'La “EU”, autoriza a la “EST” y/o a quien represente sus derechos u ostente en el futuro la calidad de acreedor para: reportar, procesar, solicitar y divulgar toda la información referente al comportamiento crediticio de la “EU” a las centrales de Información del Sector Financiero y de crédito como: CIFIN, FENALCO- PROCREDITO, DATACREDITO o cualquier otra entidad que maneje o administre bases de datos con los mismos fines.' },
                { titulo: '32.TRIGÉSIMA SEGUNDA. HABEAS DATA.SAITEMP S.A | | SERVICIOS ADMINISTRATIVOS AL INSTANTE S.A.S. ', texto: ' o cualquier organización de la familia empresarial, como organización, tiene como objetivo primordial el prestar sus servicios bajo los estándares más altos de calidad, eficiencia y respeto por la Ley. Por ende, no puede desconocer derechos y prerrogativas que son inherentes al tratamiento de los datos personales y que están en cabeza de los titulares de los mismos. “HABEAS DATA”. En cumplimiento de lo dispuesto en la Ley 1581 de 2012 y la Ley 1273 de 2009, sus decretos reglamentarios, y demás normas que la adicionen o modifiquen, queda informado que los datos personales entregados por “EST” a través de la documentación necesaria para proceder a la contratación, o en cualquier momento de la relación contractual serán tratados por “EST”, con la finalidad de garantizar la celebración, ejecución y liquidación del presente contrato o satisfacer los requerimientos que afecten de forma directa o indirecta el mismo. PROTECCIÓN DE DATOS WEB: La protección de datos web de SAITEMP S.A | SERVICIOS ADMINISTRATIVOS AL INSTANTE S.A.S. o cualquier organización de la familia empresarial, está en la obligación de acuerdo a la Ley 1581 de 2012, sus decretos reglamentarios y cualquier normatividad que la aclare, modifique o derogue, a garantizar el buen y adecuado uso de los datos personales registrados de manera virtual o través de cualquier portal informático, como son las páginas web administradas por la organización. PROTECCIÓN DE DATOS DE FORMULARIOS: Cualquier información obtenida a través del diligenciamiento de formularios solicitados por SAITEMP S.A | SERVICIOS ADMINISTRATIVOS AL INSTANTE S.A.S. o cualquier organización del grupo empresarial, está igualmente protegida por las políticas contenidas por el presente manual, así como por las demás disposiciones que el ordenamiento jurídico colombiano trata sobre el particular. CON RESPECTO A LA PROTECCIÓN DE DATOS PERSONALES, A PROPÓSITO DE CUALQUIER PETICIÓN, QUEJA O RECLAMO POR PARTE DEL TITULAR. SAITEMP S.A | AL INSTANTE S.A.S. o cualquier organización del grupo empresarial, se regirá por el procedimiento especial dispuesto para este tipo de actuaciones, contenido en el Documento para el manejo de quejas y solicitudes de esta misma corporación. Se garantiza la protección de cualquier información obtenida por este medio, de acuerdo a las políticas y procedimientos contenidos en el presente manual de protección de datos personales y demás disposiciones legales o reglamentarias que tengan alguna incidencia sobre el particular. En todo caso, se ha establecido que el tiempo límite para dar una respuesta de fondo es de diez (10) días hábiles, en cumplimiento de lo dispuesto por la Ley 1581 de 2012. DEL DERECHO AL ACCESO O CONSULTA, A RECLAMAR, A SUPRIMIR, A LA RECTIFICACIÓN Y ACTUALIZACIÓN DE DATOS. SAITEMP S.A | AL INSTANTE S.A.S. o cualquier organización del grupo empresarial, garantiza el derecho de acceso y consulta, rectificación, supresión y actualización, según lo estipulado por la Ley 1581 de 2012. En el evento en que el titular, previa identificación, legitimidad o la de su representante debidamente acreditado, desee consultar, acceder, rectificar o actualizar cualquier información que repose en la base de datos, podrá hacerlo a través de una PQR (petición, queja o reclamo). DEL DERECHO A REVOCAR LA AUTORIZACIÓN. En el evento en que el titular, previa identificación, legitimidad o la de su representante debidamente acreditado, desee revocar la autorización para el uso de la totalidad de sus datos personales, podrá hacerlo a través de una PQR. PROTECCIÓN DE DATOS EN LOS CONTRATOS/DE LA CLÁUSULA DE PROTECCIÓN DE DATOS PERSONALES O CLÁUSULA HABEAS DATA. SAITEMP S.A | AL INSTANTE S.A.S. o cualquier organización del grupo empresarial cuenta con un tipo específico de cláusula de habeas data, dándole cumplimiento a lo estipulado en la Ley 1581 de 2012, sus decretos reglamentarios y demás disposiciones que la complementen y/o modifique, al garantizar la protección de los datos personales de los titulares que tienen algún tipo de vínculo de naturaleza contractual con la organización.' },
                { titulo: '33. TRIGÉSIMA TERCERA. USO DE IDENTIDAD GRÁFICA. ', texto: 'Las partes Autorizan y oficializan por este medio el uso de su identidad visual tanto impresa como virtual entendida como Logotipo y Naming de Marca, que en el momento este manejando de su identidad corporativa, con la finalidad que pueda ser utilizado por SAITEMP S.A | AL INSTANTE S.A.S. en su portafolio de servicios tanto físico como digital en el espacio “Empresas que confían en nuestra Marca”. Así mismo la “EU” podrá utilizar el logo de SAITEMP S.A | AL INSTANTE S.A.S con fines de estrategias comerciales de fidelización, tanto físico como digital bajo el lineamiento de marca dado del logotipo y “naming” nombre comercial de Marca que será solicitado de manera inmediata después de haber sido oficializado el CONTRATO DE PRESTACIÓN DE SERVICIOS TEMPORALES DE COLABORACIÓN en Formato PNG, JPG, PDF, archivo editable Corel, Ilustrador. Cualquier cambio de la identidad visual, deberá darla a conocer, con el ánimo de actualizarla en medios digitales y en su defecto en impresos de ambas partes.' },
                { titulo: '34.TRIGÉSIMA CUARTA. MERCADEO &amp; MARKTING. ', texto: 'La “EU” autoriza a la “EST”, el envió de acciones publicitarias tales como mensajería de texto, mensajes de chat de WhatsApp, campañas de Mailing, etiquetar en redes sociales oficiales (Campañas masivas de empleo / solicitud de vacantes); dependiendo de la creación de campañas o estrategias en común acuerdo de promoción y posicionamiento, con el objetivo de fortalecer relaciones comerciales, logrando así tener una comunicación asertiva y de apoyo, se solicita los correos y números de WhatsApp de los líderes de procesos de la “EU” tales como: Presidencia, Gerencia General, Comercial, Mercadeo y Talento Humano. Para evitar tener interceptación de datos informáticos por parte de terceros, manteniendo los lineamientos para combatir la violación de datos personales.' },
                { titulo: '35.TRIGÉSIMA QUINTA. FACTORING.', texto: 'La “EU” en caso de incumplimiento con el pago de las facturas emitidas, autoriza mediante el presente contrato, a la “EST” o quien representé sus derechos, para vender o ceder el derecho de cobro de la deuda a un tercero el cual operará bajo los lineamientos y sometimiento a la inspección y vigilancia de la Superintendencia Bancaria Y Financiera, es preciso mencionar, que la empresa que actué en representación de la “EST” es una empresa financiera legalmente autorizada para prestar el conjunto de servicios que comprende la operación de cobro, a título de venta, en firme, definitiva y como una universalidad jurídica a partir de la fecha de incumplimiento de o los pagos acordados y plasmados en las cláusulas: segunda, tercera, cuarta, décima cuarta del presente contrato, de acuerdo a la fecha de mora, donde las cuentas de cobro hacen parte integral del presente contrato a título de cláusula penal que ampara a quien represente sus derechos, la cual procederá al cobro de las facturas pendientes, costas judiciales en virtud de la Ley 45 de 1923, Ley 74 de 1989, Ley 35 de 1993 y el Decreto 3039 de 1989.' },
                { titulo: 'DOCUMENTOS ANEXOS QUE HACEN PARTE INTEGRAL DEL CONTRATO\n\n', texto: '1) Empresa Usuaria (EU):\n- RUT (Actualizado). \n- Cámara de comercio actualizada. \n- Cédula al 150% representante legal. \n- Certificado bancario.\n\n2) Empresa de Servicios Temporales (EST):\n- RUT (Actualizado). \n- Cámara de comercio actualizada. \n- Cédula al 150% representante legal. \n- Certificado bancario.\n\n3) Propuesta Económica: \n-  FUC FEGC 01-02 Formato único conocimiento contraparte.\n\n' },
                { titulo: 'FIRMAS:', texto: 'Para constancia, el presente contrato se firma en la Ciudad/Municipio de MEDELLÍN del Departamento ANTIOQUIA, el ' + new Date().toLocaleDateString() + ', en dos (2) ejemplares de igual valor, cada uno de ellos con destino a cada una de las partes.' }
            ]

